import{Highlight}from"./highlight.js";let exampleCodeElement=document.querySelector(".example-code"),exampleListElement=document.querySelector(".example-list"),examples=[];class Example{constructor(name,code){this.name=name,this.code=code.trim(" \n"),this.element=null,examples.push(this)}}function initExamples(){for(let example of examples){let exampleElement=document.createElement("div");exampleElement.classList.add("example"),exampleElement.textContent=example.name,exampleListElement.appendChild(exampleElement),example.element=exampleElement,exampleElement.addEventListener("click",(function(){for(let example of examples)example.element.classList.remove("selected");exampleElement.classList.add("selected"),exampleCodeElement.innerHTML=Highlight(example.code)}))}exampleCodeElement.innerHTML=Highlight(examples[0].code),examples[0].element.classList.add("selected")}new Example("HTTP Server",'\ninclude webr\n\nlet server = webr.Server(protocols=[webr.protocol.HTTP])\n\nsever.route("/", function handler(request) {\n    return "Hello, World!"\n})\nserver.listen("localhost", 8000)\n\n#*\nHello\nHi*#\n'),new Example("GUI App",'\ninclude {px, inch, cm} from units.length\ninclude AdkUI\n\nlet document = AdkUI.document()\nlet window = AdkUI.window(document).initialize()\n\nlet box = document.Element({\n  width: 200px,\n  height: 200px\n})\nbox.text = "Hello, World!"\n'),initExamples();